import React from "react";
import styles from "./header.module.css";
import { Link } from "react-router-dom";
const Header = ({useButtons}) => {
  return (
    <div className={styles.head_wrapper}>
      <div className={styles.head_container}>
        <img src="./images/logo.png" alt="logo" width={50} />
        <div className={`flexCenter ${styles.head_menu}`}>
          
          <a href=""><Link to = "/"> Home</Link></a>
          <a href=""> <Link to = "/"> Summarize / Question </Link></a>
          <a href=""> <Link to = "/Note"> Note </Link> </a>
          <a href=""> <Link to ='/'> About </Link>  </a>
        </div>
        <div className={styles.daynight_btn}>
        <img src="./images/night-mode.png"/>
        </div>
        
        {useButtons  ? ( 
          
          <>
          <div className={`buttons ${styles.buttons}`}>
          <button className={` btn_1 ${styles.login_btn}`}> <Link to = "/Login"> Login </Link> </button>
          <button className={`btn_2 ${styles.signUp_btn}`}> <Link to = "/Signup"> SignUp </Link> </button>
          </div>
          </>):
          (<div className={styles.account}>
            <div className={styles.account_img}> 
             <img src="./images/user.png" />
            </div>
            <div className={styles.account_detail}>
            <h1>Yonas Alemu</h1>
            <p>yonasAlemu@gmail.com</p>
            </div> 
          </div>
            )
          }
        
      </div>
    </div>
  );
};

export default Header;
